export const TOGGLE_ICON_VISIBILITY = (state, showIcon) => {
    state.showIcon = showIcon; // Toggle the showIcon state
  };

  export const SET_ICON_VISIBILITY = (state, newValue) => {
    state.showIcon = newValue;
  };
